const container = document.getElementById('container');
const canvas = document.getElementById('canvas1');
const file = document.getElementById('fileupload');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const ctx = canvas.getContext('2d');
let audioSourse;
let analyser;

container.addEventListener('click', function() {
    const audio1 = document.getElementById('audio1');
    audio1.src = 'data:audio/x-wav;base64,';
    const audioContext = new AudioContext();
    audio1.play();
    audioSourse = audioContext.createMediaElementSource(audio1);
    analyser = audioContext.createAnalyser();
    audioSourse.connect(analyser);
    analyser.connect(audioContext.destination);
    analyser.fftSize = 2048;
    const bufferLength = analyser.frequencyBinCount;
    const dataArray = new Uint8Array(bufferLength);

    const barWidth = 15;
    let barHeight;
    let x;

    function animate() {
        x = 0;
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        analyser.getByteFrequencyData(dataArray);
        drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
        requestAnimationFrame(animate);
    }
    animate();
});

file.addEventListener('change', function() {
    const files = this.files;
    const audio1 = document.getElementById('audio1');
    audio1.src = URL.createObjectURL(files[0]);
    audio1.load();
    audio1.play();

    audioSourse = audioContext.createMediaElementSource(audio1);
    analyser = audioContext.createAnalyser();
    audioSourse.connect(analyser);
    analyser.connect(audioContext.destination);
    analyser.fftSize = 2048;
    const bufferLength = analyser.frequencyBinCount;
    const dataArray = new Uint8Array(bufferLength);

    const barWidth = 15;
    let barHeight;
    let x;

    function animate() {
        x = 0;
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        analyser.getByteFrequencyData(dataArray);
        drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
        requestAnimationFrame(animate);
    }
    animate();
});

function drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray) {
        for (let i = 0; i < bufferLength; i++) {
        barHeight = dataArray[i] * 1.5;
        ctx.save();
        ctx.translate(canvas.width/2, canvas.height/2); //to make it rounds
        ctx.rotate(i * Math.PI * 8 / bufferLength); //as bigger Math.PX * 'this number' as more it rounds around
        const hue = i * 0.3;
        ctx.fillStyle = 'hsl(' + hue + ',100%,' + 60 + '%)'; //works with NO filter!!! or just 'hsl(' + hue + ',100%, 50%)' or 'hsl(' + hue + ',100%,' + 70 + '%)'
        ctx.fillRect(0, 10, barWidth, barHeight); //to centrify
        x += barWidth;
        ctx.restore();
    }
}




